import NewTeam from './NewTeam';
import React, { useEffect, useState } from "react";
import '../App.css';
import './Teams.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function Teams() {
    const [teams, setTeams] = useState([])
    const [profileData, setProfileData] = useState([])

    async function fetchUser() {
        let restURL = "http://localhost:8081/race/rest/users/current";
        await fetch(restURL, {
            method: "GET",
            credentials: 'include',
            headers: {
                mode: 'no-cors',
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setProfileData(data);
            })
    }
    const fetchData = () => {
        let restURL = "http://localhost:8081/race/rest/teams/";
        fetch(restURL, {
            headers: {
                method: "GET",
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setTeams(data)
            })
    }

    useEffect(() => {
        fetchData()
        fetchUser()
    }, [])


    return (
        <div className="Page">
            <Router>
                <Link to="/newTeam">NEW TEAM</Link>
                <Routes>
                    <Route path="/newTeam" element={<NewTeam/>} />
                </Routes>
            </Router>
            <div className="Teams">
            </div>
        </div>
    );
}

export default Teams;
